import React from "react";
import "./Cart.scss";
import { ReactComponent as ShoppingIcon } from "./assests/Cart.svg";
const Cart = () => {
  return (
    <div className="cart-icon">
      <ShoppingIcon className="shopping-icon" />
      <span className="item-count">0</span>
    </div>
  );
};

export default Cart;
